<head>

    <title>Certificate of Completion</title>
    <style>
        body {
            font-family: 'Segoe UI', sans-serif;

            border: 10px solid #1e90ff;
            width: 1000px;
            height: 700px;
            margin: auto;
            box-sizing: border-box;
            position: relative;
        }

        .certificate-title {
            font-size: 36px;
            font-weight: bold;
            color: #1e90ff;
            margin-bottom: 30px;
        }

        .content {
            font-size: 20px;
            color: #333;
            margin: 20px 0;
        }

        .name {
            font-size: 28px;
            font-weight: bold;
            margin: 20px 0;
            color: #111;
        }

        .footer {
            margin-top: 40px;
            font-size: 16px;
            color: #777;
        }

        .date {
            margin-top: 10px;
            font-size: 16px;
            color: #444;
        }

        .logo {
            position: absolute;
            top: 30px;
            left: 30px;
            width: 100px;
        }
    </style>
</head>
